/** Normalize input values to [0,1] */
static inline void normalize_input(const float raw[3], float norm[3]) {
    for (int i = 0; i < 3; ++i) {
        float val = raw[i];
        if (val < INPUT_NORM_MIN[i]) val = INPUT_NORM_MIN[i];
        float max_val = INPUT_NORM_MIN[i] + INPUT_NORM_RANGE[i];
        if (val > max_val) val = max_val;
        norm[i] = (val - INPUT_NORM_MIN[i]) / INPUT_NORM_RANGE[i];
    }
}

